import {connect} from 'react-redux';
const FormModificarFotoUsuario = (props) => {
    const {usuario} = props.usuarioReducer;
    console.log(usuario);
    return (
        <form className="form-group" onSubmit={event=>event.preventDefault()}>
            <label>Seleccione la nueva imagen de perfil</label>
            <input type="file" className="form-control" name="foto"/>
            <input type="submit" className="boton bg-yellow mt-3" value="Subir"/>
        </form>
    );
}

const mapStateToProps = ({usuarioReducer})=>{
    return {usuarioReducer};
}

export default connect(mapStateToProps,)(FormModificarFotoUsuario);
